-- =====================================================
-- BAGIAN 2: FILTER DAN OPTIMASI DATABASE
-- =====================================================

print("[SYSTEM] Memuat database KBBI dengan " .. #KBBIWords .. " kata")

-- Filter dan buat index
local wordDatabase = {}
local wordIndex = {}
local wordSet = {} -- Untuk binary search

for _, word in ipairs(KBBIWords) do
    local cleanWord = string.lower(word:gsub("%s+", ""))
    if #cleanWord >= 2 and #cleanWord <= 20 then
        table.insert(wordDatabase, cleanWord)
        wordSet[cleanWord] = true
        
        local firstLetter = string.sub(cleanWord, 1, 1)
        if not wordIndex[firstLetter] then
            wordIndex[firstLetter] = {}
        end
        table.insert(wordIndex[firstLetter], cleanWord)
    end
end

-- Urutkan untuk binary search
table.sort(wordDatabase)
for letter, words in pairs(wordIndex) do
    table.sort(words)
end

print("[SYSTEM] Database siap dengan " .. #wordDatabase .. " kata terfilter")
print("[SYSTEM] Total database asli: " .. #KBBIWords)

-- =====================================================
-- BAGIAN 3: CEK JALAN DI SERVER ATAU CLIENT
-- =====================================================

local RunService = game:GetService("RunService")
local isServer = RunService:IsServer()

if isServer then
    -- ==================== SERVER SCRIPT ====================
    local ReplicatedStorage = game:GetService("ReplicatedStorage")
    local Players = game:GetService("Players")

    -- Buat RemoteEvent
    local remoteEvent = Instance.new("RemoteEvent")
    remoteEvent.Name = "LastLetterEvent"
    remoteEvent.Parent = ReplicatedStorage

    -- Game state
    local gameState = {
        currentLetter = string.char(math.random(97, 122)),
        usedWords = {},
        players = {},
        roundActive = false,
        timer = 15,
        defaultTimer = 15,
        roundNumber = 0,
        totalWordsPlayed = 0
    }

    -- Binary search function
    local function binarySearch(word)
        local low, high = 1, #wordDatabase
        while low <= high do
            local mid = math.floor((low + high) / 2)
            local midWord = wordDatabase[mid]
            
            if midWord == word then
                return true
            elseif midWord < word then
                low = mid + 1
            else
                high = mid - 1
            end
        end
        return false
    end

    -- Fungsi validasi kata
    local function isValidWord(word, firstLetter)
        word = string.lower(word:gsub("%s+", ""))
        
        if #word < 2 then
            return false, "Kata terlalu pendek (minimal 2 huruf)"
        end
        
        if string.sub(word, 1, 1) ~= string.lower(firstLetter) then
            return false, "Kata harus dimulai dengan huruf: " .. string.upper(firstLetter)
        end
        
        if not binarySearch(word) then
            -- Beri saran
            local suggestions = wordIndex[firstLetter] or {}
            local suggestList = {}
            for i = 1, math.min(5, #suggestions) do
                table.insert(suggestList, suggestions[i])
            end
            if #suggestList > 0 then
                return false, "Kata tidak ditemukan. Contoh: " .. table.concat(suggestList, ", ")
            else
                return false, "Kata tidak ditemukan di database KBBI"
            end
        end
        
        -- Cek duplikat
        for _, usedWord in ipairs(gameState.usedWords) do
            if word == usedWord then
                return false, "Kata '" .. word .. "' sudah digunakan"
            end
        end
        
        return true, word
    end

    -- Fungsi mendapatkan saran kata
    local function getSuggestions(letter)
        return wordIndex[letter] or {}
    end

    -- Fungsi memulai ronde baru
    local function startNewRound(startingLetter)
        gameState.roundNumber = gameState.roundNumber + 1
        gameState.currentLetter = startingLetter or string.char(math.random(97, 122))
        gameState.usedWords = {}
        gameState.roundActive = true
        gameState.timer = gameState.defaultTimer
        
        remoteEvent:FireAllClients("NewRound", {
            letter = gameState.currentLetter,
            timer = gameState.timer,
            roundNumber = gameState.roundNumber
        })
        
        print("[GAME] Ronde #" .. gameState.roundNumber .. " dimulai dengan huruf: " .. gameState.currentLetter:upper())
    end

    -- Handler submit word
    local function handleWordSubmission(player, word)
        if not gameState.roundActive then
            remoteEvent:FireClient(player, "Error", "Tidak ada ronde yang aktif")
            return
        end
        
        local isValid, message = isValidWord(word, gameState.currentLetter)
        
        if isValid then
            local lastLetter = string.lower(string.sub(word, -1))
            
            table.insert(gameState.usedWords, word)
            gameState.currentLetter = lastLetter
            gameState.timer = gameState.defaultTimer
            gameState.totalWordsPlayed = gameState.totalWordsPlayed + 1
            
            -- Update score player
            if not gameState.players[player.Name] then
                gameState.players[player.Name] = {score = 0, words = {}}
            end
            gameState.players[player.Name].score = (gameState.players[player.Name].score or 0) + 1
            table.insert(gameState.players[player.Name].words, word)
            
            remoteEvent:FireAllClients("WordAccepted", {
                player = player.Name,
                word = word,
                nextLetter = lastLetter:upper(),
                usedWords = gameState.usedWords,
                scores = gameState.players,
                totalWords = gameState.totalWordsPlayed
            })
            
            -- Kirim saran
            local suggestions = getSuggestions(lastLetter)
            if #suggestions > 0 then
                local suggestionList = {}
                for i = 1, math.min(5, #suggestions) do
                    table.insert(suggestionList, suggestions[i])
                end
                remoteEvent:FireAllClients("Suggestions", {
                    letter = lastLetter:upper(),
                    words = suggestionList
                })
            end
            
            print("[GAME] " .. player.Name .. " mengetik: " .. word .. " -> " .. lastLetter:upper())
        else
            remoteEvent:FireClient(player, "WordRejected", {
                word = word,
                reason = message
            })
        end
    end

    -- Player added handler
    local function onPlayerAdded(player)
        print("[SYSTEM] " .. player.Name .. " bergabung")
        
        gameState.players[player.Name] = {
            player = player,
            score = 0,
            words = {}
        }
        
        player:SetAttribute("Score", 0)
        
        if gameState.roundActive then
            remoteEvent:FireClient(player, "CurrentState", {
                letter = gameState.currentLetter,
                usedWords = gameState.usedWords,
                timer = gameState.timer,
                scores = gameState.players,
                roundNumber = gameState.roundNumber
            })
        end
    end

    -- Player removing handler
    local function onPlayerRemoving(player)
        print("[SYSTEM] " .. player.Name .. " keluar")
        gameState.players[player.Name] = nil
    end

    -- Connect events
    Players.PlayerAdded:Connect(onPlayerAdded)
    Players.PlayerRemoving:Connect(onPlayerRemoving)

    -- Remote event handler
    remoteEvent.OnServerEvent:Connect(function(player, action, data)
        if action == "SubmitWord" then
            handleWordSubmission(player, data.word)
        elseif action == "StartGame" then
            if not gameState.gameStarted then
                gameState.gameStarted = true
                gameState.roundNumber = 0
                startNewRound()
            end
        elseif action == "RestartGame" then
            gameState.gameStarted = true
            gameState.roundNumber = 0
            gameState.totalWordsPlayed = 0
            startNewRound()
        elseif action == "GetStats" then
            remoteEvent:FireClient(player, "Stats", {
                totalWords = #wordDatabase,
                totalRounds = gameState.roundNumber,
                totalPlayed = gameState.totalWordsPlayed,
                players = gameState.players
            })
        end
    end)

    -- Timer loop
    coroutine.wrap(function()
        while true do
            task.wait(1)
            
            if gameState.roundActive and #gameState.usedWords > 0 then
                gameState.timer = gameState.timer - 1
                remoteEvent:FireAllClients("TimerUpdate", gameState.timer)
                
                if gameState.timer <= 0 then
                    gameState.roundActive = false
                    remoteEvent:FireAllClients("RoundEnded", {
                        reason = "Waktu habis!",
                        usedWords = gameState.usedWords,
                        scores = gameState.players,
                        totalWords = gameState.totalWordsPlayed
                    })
                    
                    task.wait(5)
                    startNewRound()
                end
            end
        end
    end)()

