    local function updateScoreBoard(scores)
        for _, child in ipairs(scoreBoard:GetChildren()) do
            if child:IsA("Frame") and child ~= scoreTitle then
                child:Destroy()
            end
        end
        
        if scores then
            local scoreArray = {}
            for name, data in pairs(scores) do
                table.insert(scoreArray, {
                    name = name,
                    score = data.score or 0
                })
            end
            
            table.sort(scoreArray, function(a, b)
                return a.score > b.score
            end)
            
            for i, data in ipairs(scoreArray) do
                local scoreFrame = Instance.new("Frame")
                scoreFrame.Size = UDim2.new(1, -10, 0, 30)
                scoreFrame.BackgroundColor3 = Color3.fromRGB(45, 45, 55)
