    -- Remote event listeners
    remoteEvent.OnClientEvent:Connect(function(action, data)
        if action == "NewRound" then
            letterLabel.Text = data.letter:upper()
            timerLabel.Text = data.timer .. "s"
            roundLabel.Text = "Ronde: " .. (data.roundNumber or "?")
            statusLabel.Text = " Giliranmu! Ketik kata dimulai dengan huruf " .. data.letter:upper()
            statusLabel.TextColor3 = Color3.fromRGB(0, 255, 0)
            
            for _, child in ipairs(usedWordsFrame:GetChildren()) do
                if child:IsA("TextLabel") and child ~= usedWordsTitle then
                    child:Destroy()
                end
            end
            
        elseif action == "WordAccepted" then
            statusLabel.Text = " Kata '" .. data.word .. "' diterima! Huruf selanjutnya: " .. data.nextLetter
            statusLabel.TextColor3 = Color3.fromRGB(0, 255, 0)
            letterLabel.Text = data.nextLetter
            totalWordsLabel.Text = "Total: " .. (data.totalWords or "?")
            addToUsedWords(data.word .. " (" .. data.player .. ")")
            
            if data.scores then
                updateScoreBoard(data.scores)
            end
            
        elseif action == "WordRejected" then
            statusLabel.Text = " " .. data.reason
            statusLabel.TextColor3 = Color3.fromRGB(255, 0, 0)
            
        elseif action == "Suggestions" then
            local suggestText = " Saran: "
            for i, word in ipairs(data.words) do
                suggestText = suggestText .. word
                if i < #data.words then
                    suggestText = suggestText .. ", "
                end
            end
            statusLabel.Text = suggestText
            statusLabel.TextColor3 = Color3.fromRGB(100, 255, 150)
            
        elseif action == "TimerUpdate" then
            timerLabel.Text = data .. "s"
            if data <= 3 then
                timerLabel.TextColor3 = Color3.fromRGB(255, 0, 0)
            else
                timerLabel.TextColor3 = Color3.fromRGB(255, 150, 150)
            end
            
        elseif action == "RoundEnded" then
            statusLabel.Text = " Ronde berakhir: " .. data.reason
            statusLabel.TextColor3 = Color3.fromRGB(255, 150, 0)
            letterLabel.Text = "?"
            timerLabel.Text = "0s"
            
            if data.scores then
                updateScoreBoard(data.scores)
            end
            
            if data.totalWords then
                totalWordsLabel.Text = "Total: " .. data.totalWords
            end
            
        elseif action == "CurrentState" then
            letterLabel.Text = data.letter:upper()
            roundLabel.Text = "Ronde: " .. (data.roundNumber or "?")
            statusLabel.Text = " Terhubung ke ronde yang sedang berlangsung"
            
            for _, word in ipairs(data.usedWords or {}) do
                addToUsedWords(word)
            end
            
            if data.scores then
                updateScoreBoard(data.scores)
            end
            
        elseif action == "Stats" then
            local statsMsg = " STATISTIK \n"
            statsMsg = statsMsg .. "Database: " .. (data.totalWords or "?") .. " kata\n"
            statsMsg = statsMsg .. "Ronde: " .. (data.totalRounds or "0") .. "\n"
            statsMsg = statsMsg .. "Total Kata: " .. (data.totalPlayed or "0")
            
            statusLabel.Text = statsMsg
            statusLabel.TextColor3 = Color3.fromRGB(150, 200, 255)
            
        elseif action == "Error" then
            statusLabel.Text = " Error: " .. data
            statusLabel.TextColor3 = Color3.fromRGB(255, 0, 0)
        end
    end)
    
